'''creates a screen 120 pixels wide by 30 pixels high'''

class Pixel():
    def __init__(self, xCo, yCo, val) -> None:
        self.xCo = xCo
        self.yCo = yCo
        self.val = val

    def returnX(self):
        return self.xCo

    def returnY(self):
        return self.yCo

    def returnVal(self):
        return self.val

    


